import React from "react";
import { FaFacebookF, FaTwitter, FaLinkedin } from "react-icons/fa";

const Header = () => {
  return (
    <div className="flex items-center justify-between w-full px-10 py-3 border-b">
      {/* Left Side - Book Online */}
      <a href="#" className="text-blue-600 font-bold text-lg">
        <span className="text-2xl">B</span>ook<span className="font-normal">online</span>
      </a>

      {/* Middle - Social Media Icons */}
      <div className="flex items-center gap-4 text-gray-400 text-xl">
        <a href="https://www.facebook.com" target="_blank" rel="noopener noreferrer" className="hover:text-gray-600">
          <FaFacebookF />
        </a>
        <a href="https://www.twitter.com" target="_blank" rel="noopener noreferrer" className="hover:text-gray-600">
          <FaTwitter />
        </a>
        <a href="https://www.linkedin.com" target="_blank" rel="noopener noreferrer" className="hover:text-gray-600">
          <FaLinkedin />
        </a>
      </div>

      {/* Divider */}
      <div className="h-6 w-[1px] bg-gray-300"></div>

      {/* Right Side - Phone Number */}
      <a href="tel:8552295934" className="text-blue-900 font-bold text-lg">
        855-229-5934
      </a>
    </div>
  );
};

export default Header;
